import React from 'react'
import Loading from '../Loading/Loading'
// import { repo } from '../../data'

function ReposDiv({data}) {
  console.log(data);
  let color = 'blue'

  return (
    <div className='data'>

      {
        data.length ?
        data.map((anime) => (
     <>
      <div className='repoDiv' key={anime.name}>
        <div className="link">
          <a href={anime.html_url} >{anime.name}</a>
          <span className="visibility">{anime.visibility}</span>
        </div>
        <p className="description">{anime.uniqueTraits}</p>
        <p className='info'>
          <div className={color}
          ></div> 
          <span className="language">{anime.language}</span> 
          <span className="stars">&#9733; <p className="star">{anime.stargazers_count}</p></span>
          </p>
      </div>
      </>
        ))
      : <Loading/>
      }

    </div>
  )
}

export default ReposDiv
